import React, { useState, useEffect } from 'react'

function Root() {

  const [data, setData] = useState([{}])
  useEffect(() => {
    fetch("/api/v1/places"
    ).then(
      res => res.json()
    ).then(
      data => {
        setData(data)
        console.log(data)
      }
    )
  }, [])

  return (
    <div>
      {data.map((x, i) => (
        <p key={i}>{x.title}
          <br />
          {x.id}</p>
      ))
      }
    </div >
  )
}

export default Root;
